import styled from 'styled-components/native';
import {RectButton} from 'react-native-gesture-handler';

export const Container = styled(RectButton)`
width: 70%;
height: 60px;
background: #e31f26;
border-radius: 10px;
margin-top: 8px;

justify-content:center;
align-items: center;
`;
export const ButtonText = styled.Text`

color: #fff;
`;
